import React from 'react'
import logo from './assets/logo.png'

function Home() {
    return (
        <div className="bg-headerColor ">
            <div>
                <img alt="" src={logo} className="w-6 ml-12 mt-12"/>
            </div>
        </div>
    )
}

export default Home
